import React from "react";
import '../assets/css/footer.css'

const Footer = () => {
    return(
        <div className="Footer">
            <ul>
                <li>Trabalhe conosco</li>
                <li>Termos e condições</li>
                <li>Contato</li>
            </ul>

            <br />
            &copy; Copyright 2022-2022 Projeto PWEB <br />
            Rua Francisco Mota 572 - Pres. Costa e Silva, Mossoró - RN, 59625-900  UFERSA
        </div>
    );
};

export default Footer;
